import { useEffect, useState } from 'react';

export default function CRON(props) {
  const [cronState, setCronState] = useState(null);

  useEffect(()=>{
    console.log(cronState)
  }, [cronState])
  useEffect(()=>{
    fetch("http://localhost:4000/api/monitor/cron").then(res => res.json())
    .then(cron => {
      console.log(Object.keys(cron))
      setCronState(cron)
    })
  },[])

  return (
    <div className={`card-wrapper ${props.className}`}>
      <p className="card-title">CRON</p>
      <table>
        <thead>
          <tr>
            <th>Keys</th>
            <th>Values</th>
          </tr>
        </thead>
        <tbody>
          {cronState && Object.keys(cronState).map((item, index)=>{
            <tr key={index}>
              <td>{item}</td>
              <td>{cronState[item]}</td>
            </tr>
          })}
        </tbody>
      </table>
    </div>
  )
}
